jQuery(function(t){t("span.star").on("click",function(){t(this).hasClass("glyphicon-star-empty")?t.ajax({type:"POST",url:"/add_favorites/",dataType:"json",data:{item:t(this).attr("id")},context:this,success:function(){t(this).toggleClass("glyphicon-star-empty glyphicon-star")}}):t.ajax({type:"POST",url:"/del_favorites/",dataType:"json",data:{item:t(this).attr("id")},context:this,success:function(){t(this).toggleClass("glyphicon-star glyphicon-star-empty")}})})});
